uil sont grilles à l\'avance à couleur café brun foncé ainsi donnant un gout qui est unique à isle. Des combinaison spéciales de condiments  sont utilisées sélect type de légume, viande ou poisson. Nos plats au cari sont excellents avec du riz, string hoppers, rotti, pittu et dosai.','n',0,0,'t',0,'',460,'fr',0),(5648,'Accompagnements','Ces accompagnements sont une caractéristique unique dans la cuisine d\'Asie du Sud. Ils sont essentiels à la saveur des sauces et épices plats principaux.','n',0,0,'t',0,'',460,'fr',0),(5649,'Desserts','','n',0,0,'t',0,'',460,'fr',0),(5650,'Boissons','','n',0,0,'t',0,'',460,'fr',0),(5651,'Appetizers','','n',0,0,'t',0,'',460,'en',0),(5652,'Biryani Entrées','Biryani is a very rich pilau served at festive occasions. The meat which has been pre-cooked in special spices is covered in basmati rice which has been cooked and delicately spiced with cardamon and saffron. Finally the biryani is gently steamed to blend the flavours. ','n',0,0,'t',0,'',460,'en',0),(5653,'Thali Entrées','Six separate dishes of curried vegetables with steamed basmati rice and pappadam. It is popularly known as rice and curries.','n',0,0,'t',0,'',460,'en',0),(5654,'Dosa','Lightly spiced, pan-fried crepes of urid daal served either as plain dosai with side dishes or cooked and filled with curried vegetables. All our dosai dishes are served with the traditional sambar (curried, mixed vegetable sauce) dosa coconut chutney.','n',0,0,'t',0,'',460,'en',0),(5655,'Roasts','Ceylona style roasts.','n',0,0,'t',0,'',460,'en',0),(5656,'Fried Rice','Spiced meat or vegetables are combined with steamed basmati rice, steamed green beans, peas and other vegetables, stir-fried with herbs and spices.','n',0,0,'t',0,'',460,'en',0),(5657,'Noodles','Thin strips of noodles and vegetables or spiced chicken or beef chopped and stir fried with a fine blend of onions, herbs and spices.','n',0,0,'t',0,'',460,'en',0),(5658,'Rotti','Very popular in Sri Lanka, Kothu rotti is made of chopped flat b